script: |
  super -f text -I q5639.spq | sort > q5639.out

inputs:
  - name: q5639.spq
    data: |
      SELECT DISTINCT col2 * col2 + ( - col1 + + tab1.col0 * - tab1.col1 ) AS col1 FROM tab1 (FORMAT parquet);
  - name: tab1

outputs:
  - name: q5639.out
    data: |
      2599
      2812
      8163
